import React from "react";

function ListItem(props) {
    return (
        <div className="row p-5">
            <img src={props.item.urlfoto} alt="" className="w-100" />
            <div className="row text-center">
                <a
                    style={{
                        fontWeight: 700,
                        fontSize: 20
                    }}
                >
                    <p>barang id : {props.item.id}</p>

                    {props.item.name}
                    <p>{props.item.stok}</p>
                    <p>Rp {props.item.harga}</p>
                </a>
            </div>
        </div>
    );
}
export default ListItem;
